MongoDB using NodeJS api return Null why?<p>I know there is a lot of post about that but none have my problem, my tables exist, the path work to some extent but two of the request just return null and I have no idea why.
Here the request that dont work :</p>
<pre><code>// *Get Chat Message*
router.get(&quot;/message/:MessageId&quot;,async(req, res)=&gt;{
try{
    const message = await Message.findById(req.params.MessageId);
    res.status(200).json(message)
    } catch (err){
        res.status(500).json(err)
    }
})
// *Get All Chat Message*
router.get(&quot;/message/findAll&quot;,async(req, res)=&gt;{
try {
    const messages = await Message.find();
    res.status(200).json(messages)
} catch (err) {
    res.status(500).json(err);
}
</code></pre>
<p>})</p>
<p>If need here is the rest of the file where ALL the requests work PERFECTLY so I don't know why only those two don't work.</p>
<pre><code>const router = require(&quot;express&quot;).Router();
const Post = require(&quot;../models/Post&quot;);
const User = require(&quot;../models/User&quot;);
const Chat = require(&quot;../models/Chat&quot;);
const Message = require(&quot;../models/ChatMessage&quot;);

// * Get a Chat *
router.get(&quot;/:firstUserId/:secondUserId&quot;, async(req, res) =&gt; {
    const chat = await Chat.findOne({ users: { $all: [req.params.firstUserId, req.params.secondUserId] } });
    res.status(200).json(chat);
})

// * Get every Chat of one user *
router.get(&quot;/:userId&quot;, async(req, res) =&gt; {
try{
    const chats = await Chat.find({ users: { $all: [req.params.userId]} });
    res.status(200).json(chats);
}catch(err){
    res.status(500).json(err);
}
})

// *Create Chat*
router.post(&quot;/&quot;,async(req, res)=&gt;{
const chat = new Chat(req.body)
try {
    const savedChat = await chat.save();
    res.status(200).json(savedChat);
}catch(err){
    res.status(500).json(err)
}
})

// *Delete Chat*
router.delete(&quot;/:firstUserId/:secondUserId&quot;,async(req, res)=&gt;{
const chat = await Chat.findOne({ users: { $all: [req.params.firstUserId, req.params.secondUserId] } });
try{
    chat.deleteOne();
    res.status(200).json(&quot;The chat has been delete successfully.&quot;)
    } catch (err){
        res.status(500).json(err)
    }
})
// *Put Chat Message*
router.put(&quot;/message&quot;,async(req, res)=&gt;{
const newMessage = new Message(req.body)
try {
    const savedMessage = await newMessage.save();
    res.status(200).json(savedMessage)
} catch (err) {
    res.status(500).json(err)
}
})
</code></pre>
<p>The schema name and parameter of the database are the same so I don't know why it doesn't work. It still returns null even if I erase the two that don't work, it only returns an error if I delete the whole file.</p>
<p>Here is my schema:</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);

const ChatMessageSchema = new mongoose.Schema({
conversationId: {
  type: String,
  required: true
},
userId: {
  type: String,
  required: true
},
content: {
  type: String,
  required: true,
  max: 5000
},
state: {
    type: Number,
    default: 0
  }
},
{ timestamps: true }
);

module.exports = mongoose.model(&quot;chat_message&quot;, ChatMessageSchema,&quot;chat_messages&quot;);
</code></pre>
<p>The table
