Mongo filter works inside the mongo shell but doesn't work when written in go<p>Mongo: 4.4
Go: 1.17.3</p>
<p>I'm trying to get documents with string field value longer than four symbols.
Here is the query I use inside mongo's shell:</p>
<pre><code>db.player.find({
    &quot;name&quot;: { &quot;$exists&quot;: true },
        &quot;$expr&quot;: { &quot;$gt&quot;: [ { &quot;$strLenCP&quot;: &quot;$name&quot; }, 4 ] } 
    })
</code></pre>
<p>And here is the same query but coded as <code>bson</code> filter in <code>go</code>:</p>
<pre><code>longName := bson.M{
    &quot;name&quot;: bson.M{&quot;$exists&quot;: true},
    &quot;$expr&quot;: bson.M{
        &quot;$gt&quot;: bson.A{
            bson.M{&quot;$strLenCP&quot;: &quot;$name&quot;},
            4,
        },
    },
}
</code></pre>
<pre><code>fmc, err := collection.Find(context.TODO(), longName)
if err != nil {
    log.Panic(err)
}
var longBoi models.Player
err = fmc.Decode(&amp;longBoi)
if err != nil {
    log.Panic(err) 
    // panic here: 
    // 2021/12/15 15:53:46 EOF
    // panic: EOF
}
</code></pre>
<p>The first will output desired documents with string field value length longer than certain number. The second will error with just <code>EOF</code>, timestamp and callstack. Debugger says that <code>batch</code> inside coursor <code>fmc</code> contains no data.</p>
<p>What's wrong in the second case?</p>

