Using new collections for each user<p>I am building an Expense Tracking app using Node.js where all the Income and Costs should get saved in a database.</p>
<p>My idea is to create a new collection for each registered user and save all their income/cost actions in that collection.</p>
<p>The things i would like to consider before writing it are:</p>
<ul>
<li>how do i name the collections</li>
<li>Efficiency of this method</li>
<li>is it even secure</li>
<li>how do i save their data when they login from an another device</li>
<li>can two users have the same collection name causing them to save their actions in one collection</li>
<li>are there any better ways to do this</li>
</ul>
<p>What i came up with to solve it was to make a model which takes the given company/user name to create a collection.</p>
<pre><code>const mongoose = require('mongoose');
const bcrypt = require ('bcrypt');
const Schema = mongoose.Schema;

const UserSchema = new Schema({
    userName: {
        type: String,
        required: true,
        unique: true
    },
    userPass: {
        type: String,
        required: true
    },
    userEmail: {
        type: String,
        required: true,
        unique: true
    }
}, { timestamps: true });

UserSchema.pre('save', async function (next) {
    try {
        const hashed = await bcrypt.hash(this.userPass, 10)
        console.log('saved user with hashed password.')
        this.userPass = hashed
        next();
    } catch {
        next(error)
    }
})

const User = mongoose.model(userName, UserSchema);

module.exports = User;
</code></pre>
<p>And that collection can only be accessed by the one who has the password for that unique name.</p>
<p>So what i would like to ask is: Are there any better ways to do this?</p>

answer:
Think of the Activity as a window. An Intent spawns a completely new window. Instead, you might want to use the `LayoutInflater` you already use in your code to inflate a new View and add it to the current View, like `View view = LayoutInflater.from(context).inflate(R.layout.my_layout);
Button button = (Button) view.findViewById(R.id.myButton);
....
aGroupView.addView(button);`[1].
If you hold on to the view you can later remove it. (?)
[1] http://stackoverflow.com/questions/6906838/android-dynamically-add-element-from-layout-xml

