Node.js app cannot connect to MongoDB Atlas cluster<p><strong>error:</strong>
server running in development mode on port 5000
errorMongoParseError: option usecreateindex is not supported
[nodemon] app crashed - waiting for file changes before starting...</p>
<p><strong>db.js</strong></p>
<pre><code>const connectDB = async () =&gt; {
  try {
    const conn = await mongoose.connect(process.env.MONGO_URI, {
      useUnifiedTopology: true,
      useNewUrlParser: true,
      useCreateIndex: true,
    });
    console.log(`MongoDB connected :${conn.connection.host}`);
  } catch (error) {
    console.error(`error${error}`);
    process.exit(1);
  }
};
export default connectDB;
</code></pre>
<p><strong>server.js</strong></p>
<pre><code>import express from &quot;express&quot;;
import dotenv from &quot;dotenv&quot;;
import connectDB from './config/db.js'
import products from './data/products.js'


dotenv.config();

connectDB()

const app = express();

app.get(&quot;/&quot;, (req, res) =&gt; {
  res.send(&quot;api is running... &quot;);
});

app.get(&quot;/api/products&quot;, (req, res) =&gt; {
  res.json(products);
});

app.get(&quot;/api/products/:id&quot;, (req, res) =&gt; {
  const product = products.find(p =&gt; p._id === req.params.id);
  res.json(product);
});


const PORT = process.env.PORT || 5000

app.listen(PORT, console.log(`server running in ${process.env.NODE_ENV} mode on port ${PORT}`));

</code></pre>

