Extract unique values from Array in aggregation pipeline<p>In my aggregation pipeline, after some previous aggregation, I end up with documents similar to these:</p>
<pre class="lang-json prettyprint-override"><code>[
  {
    &quot;_id&quot;: 0,
    &quot;group&quot;: &quot;Electronics&quot;,
    // other fields omitted for brevity
    &quot;articles&quot;: [
      {
        &quot;name&quot;: &quot;Gameboy&quot;,
        // Even more fields omitted for brevity
        &quot;area&quot;: &quot;Video Games&quot;
      },
      {
        &quot;name&quot;: &quot;Playstation&quot;,
        &quot;area&quot;: &quot;Video Games&quot;
      },
      {
        &quot;name&quot;: &quot;Refrigerator&quot;,
        &quot;area&quot;: &quot;White Goods&quot;
      }
    ]
  },
  {
    &quot;_id&quot;: 1,
    &quot;group&quot;: &quot;Food&quot;,
    &quot;articles&quot;: [
      {
        &quot;name&quot;: &quot;Apple&quot;,
        &quot;area&quot;: &quot;Fruit&quot;
      },
      {
        &quot;name&quot;: &quot;Pear&quot;,
        &quot;area&quot;: &quot;Fruit&quot;
      }
    ]
  }
]
</code></pre>
<p>I need to extract the unique <code>area</code> values from the arrays, while keeping the rest of the document intact (the <code>articles</code> aren't needed afterwards, though). The result should look like this:</p>
<pre class="lang-json prettyprint-override"><code>
[
    {
        &quot;_id&quot;: 0,
        &quot;group&quot;: &quot;Electronics&quot;,
        // other fields...
        &quot;articleAreas&quot;: [ &quot;Video Games&quot;, &quot;White Goods&quot; ]
    },
    {
        &quot;_id&quot;: 1,
        &quot;group&quot;: &quot;Food&quot;,
        &quot;articleAreas&quot;: [ &quot;Fruit&quot; ]
    }
]
</code></pre>
<p>My gut feeling is that there should be <em>some</em> way to use <code>$addToSet</code> similar to what can be done in <code>$group</code> stages, but I couldn't figure out how.</p>

