Wiring beans during integration tests with embedded mongo<p>I am using spring-boot (2.2.7.RELEASE) with webflux for a small-ish rest service with mongodb. I have 2 repositories (<code>ARepository</code>, <code>BRepository</code>) implemented something like this:</p>
<pre><code>@Repository
public interface ARepository extends ReactiveMongoRepository&lt;DataDTO, Integer&gt; {
}
</code></pre>
<p>I also have an extra service which is using these 2 and a ReactiveMongoTemplate instance. It's wired something like this:</p>
<pre><code>@Slf4j
@Service
public class DefaultTheService implements TheService {
    private final ARepository aRepository;
    private final BRepository bRepository;
    private final ReactiveMongoTemplate mongoTemplate;

    @Autowired
    public DefaultTheService(ARepository aRepository, BRepository bRepository, ReactiveMongoTemplate mongoTemplate) {
        this.aRepository = aRepository;
        this.bRepository = bRepository;
        this.mongoTemplate = mongoTemplate;
    }
}
