<p>I want to delete this document and I tried to use this code to do so (leveraging the native node-js driver for MongoDB):</p>
<pre class="lang-js prettyprint-override"><code>import { MongoClient, ObjectId } from &quot;mongodb&quot;;

export const deleteDocumentWithId = (id: string) =&gt; {
