    if (err) {
      throw err;
    }

    const dbo = db.db(&quot;my-db&quot;);

    dbo.collection(&quot;my-collection&quot;).deleteOne({ _id: id }, (err, obj) =&gt; {
      if (err) {
        throw err;
      }
      db.close();
    });
  });
};

deleteDocumentWithId(&quot;EXISTING_ID&quot;);
</code></pre>
<p>however, the TypeScript-compiler throws an error, saying that no overloads match this call; <code>_id</code> should rather be of type <code>ObjectId</code>. However, if I replace the call with:</p>
